            </React.Fragment>
        );
    }
}

const Header: React.SFC = () => (
    <div className={'siteTop'}>
        <h1>LMDB: Lica's Movie Database</h1>
    </div>
);

interface Props {

}


export class Form extends Component<Props> {
    constructor(props: Props) {
        super(props);

        this.state = {}
    }



    render () {
        const movie = this.state;
        return (
            <form>
                <label>Fav Movie: </label>
                <input type="text" />
            </form>
        )
    }
}

export default App;
